3599. Düntzer Horaz letz. Agbe [?]. Nr. 3315–3317. (S. 80)
	führte bereits drei Bände einer Düntzer-Bearbeitung des Horaz an, zu welcher jedoch noch zwei weitere Bände gehören würden. Boeckh notiert hier keine Bandnummer, der unklare Zusatz könnte auf eine "letzte Ausgabe" verweisen;
	ich verweise auf jene fehlenden zwei Bände (Teil vier und fünf).
